<?php
// Keep spitting out random letters until target word is reached [cli, low memory footprint]
// Usage: php target-word.php
// Sample output: see below

$targetWord = 'rida';
// ============= ENDS CONFIG

$targetWord = strtoupper($targetWord);
$targetWordLen = strlen($targetWord);
ob_start();

$randomLetter = function() {
    while (true)
        yield chr(rand(65, 90)); // A-Z
};

foreach ($randomLetter() as $letter) {
    print $letter;

    if (ob_get_length() === $targetWordLen) {
        $contents = ob_get_contents();
        ob_flush();

        if ($contents == $targetWord) {
            print PHP_EOL;
            break;
        }
    }
}

__halt_compiler();

